import React from 'react';
import Nav from './components/nav/nav' 
import Logo from './components/logo/logo'
import Imageform from './components/imageform/imageform'  
import './App.css';

function App() {
  return (
    <div className="App">
      <Nav />
      <Logo />
      <Imageform className='center'/>
    </div>
  );
}

export default App;
